import React from 'react';
import { useNavigate } from 'react-router-dom';

const NursePage = () => {
  const navigate = useNavigate();

  const handleNavigation = (formType) => {
    if (formType === 'administration') {
      navigate('/surveillanceform'); // Navigate to the surveillance form
    }
    // You can add additional logic for other forms if needed
  };

  return (
    <div>
      <h1>Nurse Page</h1>
      <div className="options">
        <button onClick={() => handleNavigation('administration')}>PATIENT ADMINISTRATION DETAILS</button>
        <button onClick={() => alert('Patient Surgery Details clicked')}>PATIENT SURGERY DETAILS</button>
        <button onClick={() => alert('Patient Antibiotic Details clicked')}>PATIENT ANTIBIOTIC DETAILS</button>
        <button onClick={() => alert('Patient Microbiology Details clicked')}>PATIENT MICROBIOLOGY DETAILS</button>
      </div>
    </div>
  );
};

export default NursePage;
